import './App.scss';
import guidedog from './images/guidedog.png'

function Bubble(props) {
  return (
    <div className="Bubble">
      <span class="skill-item aos-init aos-animate">
        {props.name}
      </span>
    </div>
  );
}

export default Bubble;
